Receita de Bolo de Maconha
Para a manteiga de maconha iremos usar:

100 gramas de manteiga;
8 gramas de Maconha Medicinal.


Para o Bolo de Maconha iremos precisar de:

4 ovos;
2 xícaras de açúcar
Essência de Baunilha (opcional);
1 xícara de leite;
2 xícaras de farinha;
1 colher de sopa de fermento químico;


Estes são os ingredientes base para fazer a massa do Bolo de Maconha. Se você quiser fazer um bolo de maconha sabor chocolate basta adicionar 2 colheres de sopa de chocolate em pó (se for usar achocolatado, aumente para 4 colheres de sopa). Outra dica é comprar corante alimentício verde e pingar cerca de 10 gotas na massa do seu bolo de maconha.




Maconha para Bolo.
Como fazer Bolo de Maconha


Passo 1: Manteiga Cannábica



Primeiro é importante realizar a descarboxilação do THC.  Para fazer a manteiga de maconha basta colocar a manteiga e a água no fogo baixo e quando começar a ferver adicionar a maconha. A água irá fazer com que a manteiga não se aqueça demais, preservan
